import React, { FunctionComponent } from "react";
import Skin from "../../models/skin";
import "./card.css"

type Props = {
    skin: Skin
};

const SkinCard: FunctionComponent<Props> = ({skin}) => {

    return (
        <li className='flex-row w30 flex-center-y p15'>
        <div className='flex-col'>
            <h3 key={skin.classe} className='txt-left mt0'>classe : {skin.classe}</h3>
            <img key={skin.picture} src={skin.picture}></img>
        </div>
        <div className='flex-col flex-bet pt25 pb25'>
            <div>
                {skin.color.map(color => (
                    <div className="pastille" style={{background: color}}>{color}<p key={color}>{color}</p></div>
                    
                ))}
            </div>
            <div>
                {skin.object.map(obj => (
                    <p key={obj}>{obj}</p>
                ))}
            </div>

        </div>
    </li>
    );
}

export default SkinCard;
